package leetcode

import (
	"fmt"
	"math/rand"
)

func findKthLargest(nums []int, k int) int {
	n := len(nums)
	start, end := 0, n-1
	for start < end {
		randPivot := rand.Intn(end-start+1) + start
		pivotIndex := partition(nums, start, end, randPivot)
		if pivotIndex < (n - k) {
			start = pivotIndex + 1
		} else if pivotIndex > (n - k) {
			end = pivotIndex - 1
		} else {
			return nums[pivotIndex]
		}
	}
	return nums[start]
}

func partition(arr []int, start, end, index int) int {
	pivot := arr[index]
	arr[end], arr[index] = arr[index], arr[end]
	i := start
	for j := start; j < end; j++ {
		if arr[j] < pivot {
			arr[i], arr[j] = arr[j], arr[i]
			i++
		}
	}

	arr[end], arr[i] = arr[i], arr[end]
	return i
}

